import React, { Component } from 'react';
import Layout from '../components/Layout';
import ServiceUnitPlate from '../components/services/ServiceUnitPlate';
import FormPage from '../components/form';

class AutoCenters extends Component {
  render() {
    const { serviceName } = this.props;
    return (
      <Layout>
        <ServiceUnitPlate serviceName={serviceName} />
        <div className="container-fluid vspomOborud">
          <div className="mycontainer section-plate headers">
            <div className="headers-container">
              <span className="header-min-colored">
                  {' '}
                <span className="dark-color">
                     :
                </span>
              </span>
              <p className="text">
                    :
                , , . 
                     
                    16.02.2008 . 87  
                       .
              </p>
            </div>
          </div>
          <div className="container documentation">
            <div className="row">
              <div className="col-12">
                <div className="orderlist">
                  <div className="doc-point">
                    <span className="razdel"> 1</span>
                    <p className="text-bold"> </p>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 2</span>
                    <p className="text-bold">
                          
                    </p>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 3</span>
                    <p className="text-bold"> </p>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 4 </span>
                    <p className="text-bold">
                        - 
                    </p>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 5 </span>
                    <p className="text-bold">
                         ,  
                      - , 
                      - , 
                       :
                    </p>
                    <ul className="razdel-list">
                      <li className="razdel-li">
                        <span className="text-min text-black">
                          1.  
                        </span>
                      </li>
                      <li className="razdel-li">
                        <span className="text-min text-black">
                          2. .{' '}
                        </span>
                      </li>
                      <li className="razdel-li">
                        <span className="text-min text-black">
                          3. ,   , 
                          .
                        </span>
                      </li>
                      <li className="razdel-li">
                        <span className="text-min text-black">
                          4.   .{' '}
                        </span>
                      </li>
                      <li className="razdel-li">
                        <span className="text-min text-black">
                          5.  0,4  ( )
                        </span>
                      </li>
                      <li className="razdel-li">
                        <span className="text-min text-black">
                          6.  10  (   )
                        </span>
                      </li>
                      <li className="razdel-li">
                        <span className="text-min text-black">
                          7.  ( ,  /, ,  
                          )
                        </span>
                      </li>
                    </ul>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 6 </span>
                    <p className="text-bold">
                        
                    </p>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 7 </span>
                    <p className="text-bold">
                             
                       
                    </p>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 8 </span>
                    <p className="text-bold">
                          
                    </p>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 9 </span>
                    <p className="text-bold">
                          
                    </p>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 10</span>
                    <p className="text-bold">
                          
                          
                      , ,    
                       .
                    </p>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 11 </span>
                    <p className="text-bold">  </p>
                  </div>
                  <div className="doc-point">
                    <span className="razdel"> 12 </span>
                    <p className="text-bold">
                         ,  
                      
                    </p>
                  </div>
                  <div className="doc-point">
                    <p className="text-bold"> </p>
                  </div>
                  <div className="doc-point">
                    <p className="text-bold">
                           
                       .
                    </p>
                  </div>
                  <div className="doc-point">
                    <p className="text-bold"> .</p>
                  </div>
                  <div className="doc-point">
                    <p className="text-bold">
                           ;
                    </p>
                  </div>
                  <div className="doc-point">
                    <p className="text-bold"> </p>
                  </div>
                  <div className="doc-point">
                    <p className="text-bold"> .</p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <FormPage product={this.props.serviceName} />
        <style jsx>{`
          .vspomOborud {
            margin-top: 30px;
          }
          .vspomOborud .headers-container {
            padding-left: 0px;
            padding-right: 0px;
          }
          .vspomOborud .headers-container .header-min-colored {
            display: block;
            padding-bottom: 15px;
            line-height: 26px;
          }
          .documentation .orderlist .doc-point {
            margin: 15px 0px;
          }

          .vspom-oborud {
            padding-left: 0;
            padding-right: 0;
            padding-bottom: 0px;
          }
          .vspom-oborud .row {
            padding-left: 15px;
            padding-right: 15px;
          }
          .vspom-oborud .row .otstup {
            display: block;
            padding-left: 15px;
            padding-right: 15px;
          }
          .vspom-oborud .row .otstup .cta {
            display: block;
            text-align: center;
            font-weight: 700;
            line-height: 28px;
            font-size: 14px;
            margin-top: 30px;
          }
          .vspom-oborud .row .otstup .header-min-colored {
            display: block;
            margin-top: 45px;
            padding-bottom: 15px;
          }
          .vspom-oborud .row .otstup .tools-list-2 {
            display: block;
            padding: 0;
            margin-top: 15px;
          }
          .vspom-oborud .row .otstup .tools-list-2 .tool-card {
            width: 100%;
            display: flex;
            flex-direction: row;
            flex-wrap: nowrap;
            align-items: center;
            margin-top: 15px;
          }
          .vspom-oborud
            .row
            .otstup
            .tools-list-2
            .tool-card
            .img-container-22 {
            display: block;
            width: 150px;
            height: 100%;
            background-color: green;
            overflow: hidden;
          }
          .vspom-oborud
            .row
            .otstup
            .tools-list-2
            .tool-card
            .img-container-22
            .tool-card-img {
            display: block;
          }
          .vspom-oborud .row .otstup .tools-list-2 .tool-card .tool-card-desc {
            padding: 15px;
            width: 65%;
          }
          .vspom-oborud
            .row
            .otstup
            .tools-list-2
            .tool-card
            .tool-card-desc
            .text-bold {
            font-size: 12px;
            line-height: 14px;
            font-weight: 500;
          }
          .vspom-oborud .row .otstup .tools-list-2 .tool-card:nth-child(even) {
            background-color: rgb(231, 231, 231);
          }

          .documentation .orderlist .doc-point {
            margin: 15px;
          }
          .documentation .orderlist .doc-point .razdel {
            font-style: italic;
            text-transform: uppercase;
            font-size: 12px;
            line-height: 16px;
            color: grey;
          }
          .documentation .orderlist .doc-point .text-bold {
            font-size: 14px;
          }
          .documentation .orderlist .doc-point .razdel-list {
            margin-top: 15px;
            padding: 0;
            display: flex;
            flex-direction: column;
          }
          .documentation
            .orderlist
            .doc-point
            .razdel-list
            .razdel-li
            .text-min {
            font-size: 12px;
            line-height: 16px;
          }
          .tools-list {
            display: flex;
            flex-direction: column;
          }
          .tools-list .tool-card {
            display: flex;
            flex-direction: row;
            flex-wrap: nowrap;
          }
          .tools-list .tool-card .img-containeer {
            max-width: 20%;
            width: 100%;
          }

          .optimal-agregats {
            padding-bottom: 80px;
          }

          @media (min-width: 576px) {
            .vspomOborud .headers-container {
              padding-left: 0px;
              padding-right: 0px;
            }
            .vspomOborud .headers-container .header-min-colored {
              display: block;
              padding-bottom: 15px;
            }
            .vspomOborud .documentation .orderlist .doc-point {
              margin: 15px 0px;
            }
            .vspom-oborud .row {
              padding: 0;
            }
            .vspom-oborud
              .row
              .otstup
              .tools-list-2
              .tool-card
              .tool-card-desc
              .text-bold {
              font-size: 15px;
              line-height: 18px;
            }
          }

          @media (min-width: 768px) {
            .vspom-oborud .cta {
              font-size: 16px;
              margin-top: 50px;
            }
            .vspom-oborud .tools-list-2 {
              padding: 0;
            }
            .vspom-oborud .tools-list-2 .tool-card .tool-card-desc {
              padding: 15px;
              padding-left: 20px;
              width: 65%;
            }
            .vspom-oborud .tools-list-2 .tool-card .tool-card-desc .text-bold {
              font-size: 14px;
              line-height: 20px;
              font-weight: 700;
            }

            .documentation .orderlist .doc-point {
              margin: 30px 15px;
            }
            .documentation .orderlist .doc-point .razdel {
              font-style: italic;
              text-transform: uppercase;
              font-size: 14px;
              line-height: 18px;
            }
            .documentation .orderlist .doc-point .text-bold {
              font-size: 16px;
              line-height: 22px;
            }
            .documentation .orderlist .doc-point .razdel-list {
              margin-top: 15px;
              padding-left: 20px;
              display: flex;
              flex-direction: column;
            }
            .documentation
              .orderlist
              .doc-point
              .razdel-list
              .razdel-li
              .text-min {
              font-size: 13px;
              line-height: 16px;
            }
          }

          @media (min-width: 992px) {
            .vspomOborud {
              margin-top: 45px;
            }

            .vspomOborud .headers-container .header-min-colored {
              padding-bottom: 15px;
              line-height: 34px;
            }

            .vspom-oborud
              .row
              .otstup
              .tools-list-2
              .tool-card
              .tool-card-desc
              .text-bold {
              font-size: 17px;
              line-height: 22px;
            }
          }

          @media (min-width: 1200px) {
            .vspom-oborud .cta {
              font-size: 18px;
              margin-top: 50px;
            }
            .vspom-oborud .tools-list-2 {
              padding: 0;
            }
            .vspom-oborud .tools-list-2 .tool-card .tool-card-desc {
              padding: 15px;
              padding-left: 30px;
              width: 65%;
            }
            .vspom-oborud .tools-list-2 .tool-card .tool-card-desc .text-bold {
              font-size: 16px;
              line-height: 24px;
              font-weight: 700;
            }

            .documentation .orderlist .doc-point {
              margin: 30px 15px;
            }
            .documentation .orderlist .doc-point .razdel {
              font-style: italic;
              text-transform: uppercase;
              font-size: 14px;
              line-height: 20px;
            }
            .documentation .orderlist .doc-point .text-bold {
              font-size: 18px;
              line-height: 30px;
            }
            .documentation .orderlist .doc-point .razdel-list {
              margin-top: 15px;
              padding-left: 20px;
              display: flex;
              flex-direction: column;
            }
            .documentation
              .orderlist
              .doc-point
              .razdel-list
              .razdel-li
              .text-min {
              font-size: 16px;
              line-height: 24px;
            }
          }
        `}</style>
      </Layout>
    );
  }
}

AutoCenters.getInitialProps = async function(context) {
  const serviceName = context.query.serviceName;

  return { serviceName };
};

export default AutoCenters;
